import request from "../../utils/request";

export default {
    getRedisInfo() {
        return request.get('/redis/info').then(res => {
            if (res.data.code === 0) return res.data.data;
        })
    },
    getRedisMemoryInfo() {
        return request.get('/redis/memoryInfo').then(res => {
            if (res.data.code === 0) return res.data.data;
        })
    },
    getRedisKeySize() {
        return request.get("/redis/keySize").then(res => {
            if (res.data.code === 0) return res.data.data;
        })
    }
}
